import React, {Component} from "react"



class Project extends Component {

    render(){
        return (
            <div className="project">
                <h1>Project Name</h1>
                <p>this is the project description</p>
                <div>
                    <button onClick={this.props.removeProject}>Delete</button>
                </div>
            </div>
        );
    }
}

export default Project
